import React, { Component } from "react";
import './app.css'
import Col from 'react-bootstrap/Col';

class App extends Component {
    render(){
        let div = (
            <p>Hello World</p>
        )
        return(
            <Col className="wrapper">
                {div}
            </Col>
        )
    }
}

export default App;
